	ld	[%l2], %l7			/* point to next area */
	mov	%l1, %l4			/* offset table size */
	mov	%l3, %l5			/* offset table */
2:
	ld	[%l5], %l6			/* get next offset */
	ld	[%l6+%l7], %o0			/* preload d$ with data */
	deccc	%l4				/* loop until out of offsets */
	bne	2b
	add	%l5, 4, %l5

/*
 * only need to do one area because areasize = D$ size
 */
	deccc	%l0				/* loop until out of areas */
	bne	1b
	add	%l2, 4, %l2

/*
 * Execute random code for a second time
 */
	set	t7_data_exp_fp, %sp		/* setup stack pointer */
	save	%sp, 0, %sp			/* setup %sp in all windows */
	save	%sp, 0, %sp
	save	%sp, 0, %sp
	save	%sp, 0, %sp
	save	%sp, 0, %sp
	save	%sp, 0, %sp
	save	%sp, 0, %sp
	save	%sp, 0, %sp
#ifdef SET_WORKS
	set	t7_ktbl, %o0			/* execute random code */
#else
	setx	t7_ktbl, %l0, %o0		/* execute random code */
#endif
        set     t7_data_exp_regs, %o1
        set     t7_data_exp_mtbl_size, %o2
        ld      [%o2], %o2
        set     t7_data_exp_mtbl, %o3
	mov	XFLAG_SGI|XFLAG_V9, %o4
t7_two_pass_execute:
        call    __kaos
        nop
#endif

#if defined(T7_KAOS_VERIFY)
/*
 * Code to verify expected==observed
 * Do not run this option under RTL because it takes forever
 */
t7_kverify_regs:
	set	t7_data_in_regs, %o0		/* Point to observed regs */
	set	t7_data_exp_regs, %o1		/* Point to expected regs */
	call	t7_kcmp				/* Compare expected/observed registers */
	set	KDATA_MAX_IDX, %o2		/* Count of words to compare */

t7_kverify_area:
	set	T7_KAOS_AREAS, %l0		/* get area table size */
	set	t7_data_in_mtbl, %l1		/* point to observed area pointers */
	sub	%l1, 16, %l1
	set	t7_data_exp_mtbl, %l2		/* point to expected area pointers */
	sub	%l2, 16, %l2
	set	t7_data_in_area0, %l3		/* Calculate offset to beginning of area */
	set	t7_data_in_area0_begin, %l4
	sub	%l3, %l4, %l3
	set	t7_data_in_area0_end, %l4	/* Calculate number of words in each area */
	set	t7_data_in_area0_begin, %l5
	sub	%l4, %l5, %l4
	srl	%l4, 2, %l4
t7_kverify_area_loop:
	sub	%l1, 4, %l1			/* Point to next area */
	sub	%l2, 4, %l2
	ld	[%l1], %o0			/* Point to start of observed area data */
	sub	%o0, %l3, %o0
	ld	[%l2], %o1			/* Point to start of expected area data */
	sub	%o1, %l3, %o1
	call	t7_kcmp				/* Compare expected/observed areas */
	mov	%l4, %o2			/* Setup count of words to verify */

	deccc	%l0				/* loop until out of areas */
	bne	t7_kverify_area_loop
	nop
#endif


        ta      T_GOOD_TRAP
        nop


			

/************************************************************************
   Routine to compare expected/observed  values
   Input:
	%o0	observed data pointer
	%o1	expected data pointer
	%o2	count of words to compare
 ************************************************************************/
#if defined(T0_KAOS_VERIFY)
t0_kcmp:
	ld	[%o0], %o3
	ld	[%o1], %o4
	cmp	%o3, %o4
	tne	BAD_TRAP
	deccc	%o2
	bne	t0_kcmp
	nop

	retl
	nop
#endif


